import styled from "styled-components";

export const PageUlStyle = styled.ul`
  display: flex;
  justify-content: center;
  margin: 0 auto;
  gap: 50px;

  button {
    font-family: "Roboto";
    font-weight: 500;
    font-size: 1.6rem;
    color: #828282;
  }
`;
